DROP TABLE IF EXISTS zabytki;

CREATE TABLE zabytki(
    id integer PRIMARY KEY not null identity (1,1),
    ulica varchar(255),
    numer varchar(50),
    obiekt varchar(max) not null,
    nr_rejestru varchar(100) not null,
    data_wpisu date not null,
    decyzja varchar(255),
	modyfikowano bit default 0
);





select top 10 with ties * from zabytki order by id;

select count(*) from zabytki;

select * from zabytki where modyfikowano = 1;

select * from zabytki where id >430;
